import React from "react";
import Profile from "./Profile";
import './Enter.css';
import Education from "./Education";
import { useState } from "react";
import MathTest from "./SubjectPages/MathTest";
import { BrowserRouter as Router, Routes,Route, Link } from 'react-router-dom';

function Enter(){
    const [subjectId, setSubjectId] = useState(true);

    const handlePage = () => {
        setSubjectId(!subjectId);
    };

    return (
        <div className="window">
            <div className='profileBar'>
                <Profile></Profile>
            </div>
            <div className='contents'>
                <div class='element'>
                    <Education></Education>
                    <Router>
                        <Routes>
                        <Route exact path="/enter" element={<Enter/>} />
                        <Route path="/enter/test/math" element={<MathTest/>} />
                        <Route path="/enter/strudy/math" element={<MathStudy/>} />
                        </Routes>
                    </Router>
                </div>
            </div>
        </div>
    );
}

export default Enter;
